import React, { useState, useEffect } from 'react';
import BottomNavbar from '../components/Navbar';
import Header from '../components/Header';

const TodoMateriel = ()=>{
    const [materiels, setMateriels]= useState([]);
    useEffect(()=>{
        fetch('http://localhost:5257/api/materiel')
            .then(response => {
                if (!response.ok){
                    throw new Error('Failed to fetch chantier');
                }
                return response.json();
            })
            .then(data => {
                setMateriels(data)
            })
            .catch(error => {
                console.error('Error fetching materiels:', error);
            });
    }, []);
    return (
        <div>
            <Header titre="Liste MatÃ©riels"/>
            <ul>
                {materiels.map((materiel, index) => (
                    <li key={index}>{materiel.label}</li>
                ))}
            </ul>
            <BottomNavbar/>
        </div>
    );
}
export default TodoMateriel;
